module.exports = "<div class=\"container\">\n\n    <!-- Heading Row -->\n    <div class=\"row my-4\">\n      <div class=\"col-lg-8\">\n\nడిట్రాయిట్ తెలుగు సాహితీ సమితి\n\n(Detroit Telugu Literary Club)\n\n \n\n2018 సంవత్సరంలో  చర్చకు ఎన్నుకున్న పుస్తకాలు, సమావేశాలు\n\n \n\nప్రదేశం: శ్రీ వేంకటేశ్వరస్వామి ఆలయ ప్రాంగణం, నోవై,మిషిగన్\n\n \n\nసమయం: మధ్యాహ్నం 2:30 నుండి 5:30 గం|| వరకు\n\n \n\n1/7/2018 -- ప్రజల మనిషి  (వట్టికోట ఆళ్వారుస్వామి నవల)\n\n2/4/2018 -- విదేశ గమనే (తాడికొండ శివకుమార శర్మ కథలు)\n\n3/4/2018 – అంధకారం లో  (రంగనాయకమ్మ నవల)\n\n4/1/2018 – సాహిత్య హింసావలోకనం  (నండూరి పార్ధసారధి  హాస్య రచన)\n\n5/6/2018 – హంపి నుండి హరప్పా దాకా  (తిరుమల రామచంద్ర చారిత్రక రచన)\n\n6/3/2018 – మరీచిక  (సీతాదేవి నవల)\n\n7/1/2018 – కతల గంప  (కథల సంకలనం - సంపాదకులు: స.వెం.రమేష్)\n\n8/5/2018 – జయకాంతన్ కథలు  (జయకాంతన్ కథల తెలుగు అనువాదం)\n\n \n\n9/29-30/2018 – డిట్రాయిట్ తెలుగు సాహితీ సమితి 20 - సంవత్సరాల వేడుకలు\n\n \n\n11/4/2018 – గబ్బగీమి  (మంచికంటి  నవల)\n\n12/2/2018 - కథ 2017 (కథల సంకలనం - సంపాదకులు: నవీన్, శివశంకర్) \n\n</div>\n</div>\n</div>\n"

